import React from 'react';
import { CREATE_ROOM } from "../actions";

const initialState = {
    id: 0,
    name: 'ルーム番号',
    room: []
}

const testReducer = (state = initialState, action) => {
    switch (action.type) {
        case CREATE_ROOM:
            const newRoom = (
                <div>{state.name}{state.id}</div>
            )
            state.room[state.id] = newRoom;
            state.id++;
            return newRoom;
        default:
            return state.room;
    }
}

export default testReducer;
